import styled from "styled-components"


export const Header = styled.div`
    height: 64px;
    align-items: center;
    justify-content: center;
    display: flex;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
`;

export const Container = styled.div`
    position: absolute;
    width: 375px;
    height: 436px;
    left: 0px;
    top: 0px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
`;

export const HeaderButtonLeft = styled.button`
    margin-left: 10px;
    left: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;
export const Button = styled.button`
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: flex-start;
    padding: 18px 129px;
    position: absolute;
    width: 315px;
    height: 60px;
    left: 30px;
    top: 1213px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    box-shadow: 0px 10px 22px rgba(149, 173, 254, 0.3);
    border-radius: 99px;
`;
